	context "context"
	rapiddocs "github.com/mixed-file-directory/rapiddocs"
	rapiddocsclient "github.com/mixed-file-directory/rapiddocs/client"
)

client := rapiddocsclient.NewClient()
response, err := client.Organization.Create(
	context.TODO(),
	&rapiddocs.CreateOrganizationRequest{
		Name: "name",
	},
)

